import React from "react";
import {Carousel} from "react-multi-carousel";

const DiscoverCarousel = ({books}) => {
    return (
        <Carousel>
            <Carousel.Item>
                <div className="shelf-wrapper">

                </div>
                <img className="d-block w-100"
                     src="images/Discover/book1.png"
                     alt="first book"/>
            </Carousel.Item>
            <Carousel.Item>
                <img className="d-block w-100"
                     src="images/Discover/book2.png"
                     alt="second book"/>
            </Carousel.Item>

        </Carousel>
    )
}

export default DiscoverCarousel;
